    truncatedDodecahedron: () => MeshOps.truncate(Solids.PlatonicSolids.dodecahedron(), T_TRUNC_ICOS),
    truncatedIcosahedron: () => MeshOps.truncate(Solids.PlatonicSolids.icosahedron(), 1 / 3),
